	'About evoSkins...' => "O evoSkins",
	'By default, b2evolution blogs are displayed using a default skin.\n\nReaders can choose a new skin by using the skin switcher integrated in most skins.\n\nYou can change the default skin used for any blog by editing the blog parameters in the admin interface. You can also force the use of the default skin for everyone.\n\nOtherwise, you can restrict available skins by deleting some of them from the /blogs/skins folder. You can also create new skins by duplicating, renaming and customizing any existing skin folder.\n\nTo start customizing a skin, open its \'<code>_main.php</code>\' file in an editor and read the comments in there. And, of course, read the manual on evoSkins!' => "Domyślnie blogi b2evolution są wyświetlane w domyslnej skórce \nCzytelnik może wybrać nową skórkę użwywając przełącznika skórek który jest zinetgrowany w wiekszości skórek.\n\nMożesz zmienićdomyślna skórkę dla każdego blogu prze edycję parametrów blogu w inetrfejsie admina. Możesz również wymusić używanie domyślnej skórki przez wszystkich \n\nInaczej, możesz ograniczyć dostepne skórki poprzez usunięcie niektórych z folderu skórek ( skins/). Możesz równiez utworzyć nowe skórki przez kopiowanie, zmiane i dostosowanie dowolnego istniejącego folderu skórki. \n\nBy rozpocząć dostosowywanie skórki otwórz jej plik: '<code>_main.php</code>' w edytorze i czytaj komentarze zawarte tam. Oczywiście przeczytaj podręcznik o evoSkins!",
